import classes from "./ChoiceList.module.css";

const ChoiceList = () => {
  return (
    <div className={classes.container}>
      <a href="/">FAST FOOD</a>
      <a href="/">LUNCH</a>
      <a href="/">DINNER</a>
      <a>REFRESH</a>
    </div>
  );
};

export default ChoiceList;
